import React, {Component} from 'react';
import '../css/grid.css';

class GridDetail extends Component {
    render() {
        return (
            <div className="gradeItems">
                <div className="studentID">
                    <p>{this.props.grid.id}</p>
                </div>
                <div className="studentName">
                    <p>{this.props.grid.name}</p>
                </div>
                <div className="a1">
                    <p>{this.props.grid.a1}</p>
                </div>
                <div className="a2">
                    <p>{this.props.grid.a2}</p>
                </div>
            </div>
        )
            }
}
export default GridDetail;
